  input: 'TEXT,F3XA,,"May 14, 2002  Jane Parks, Campaign Finance Analyst  Federal
    Election Commisison  This amended report is a result of your letter dated April
    2, 2003 regarding the South Carolina Democratic Party''s Amended 30 Day Post-General
    Report (10/17/02-11/25/02).  An extention of time to file this amendment was granted
    by the FEC on April 24, 2003.  The items contained in this amendment directly
    correspond to the bullet points in your letter.  Item #1 see report, #2  I am
    unable to manually change the aggregate year to date totals on this Schedule F.  All
    expenditures as reported for this period are for the Alex Sanders for US Senate
    campaign.  The total is $417,321.69. #3  I am in receipt of the memo Schedule
    A information, however I am unable to import this information in it''s present
    format.  I will be amending as soon as this informtation is usuable.  #4, #5 see
    report, #6 As with an earlier amendment, this item was incorrectly paid from the
    federal account.  There was no federal element, this is the reimbursement to the
    federal account to correct the error.  #7 & #8  Items with ''voter registration''
    and/or ''GOTV'' are generic in nature and not funded using national party money.  #9  The
    description of ''office supplies'' is strictly limited to items that are used
    in an office setting for generic/administrative duties only.  #10  I appreciate
    you pointing this out."'
